      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
      <div className={styles.ctxSk}>
        <div className={styles.loading}></div>
      </div>
    </div>
  );
  let blogs = Array(count).fill(blogSkeleton);
  if(type === 'blog'){
    return <>
      {blogs.map(blog => blog)}
    </>
  } else if (type === 'blogDetail') {
    return blogDetialSk;
  } else {
    return <div>haha</div>;
  }

};

export default Skeleton;
